cos( radians('39.9333635') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('32.8597419') )
+ sin( radians('39.9333635') ) * sin( radians(map_lat) )
)
) <= '7' and `bravo_boats`.`deleted_at` is null group by `bravo_boats`.`id`) as `aggregate_table`
